/*3. 无重复字符的最长子串（中等）
    给定一个字符串，请你找出其中不含有重复字符的最长子串的长度。
示例1：
    输入: s = "abcabcbb"
    输出: 3
    解释: 因为无重复字符的最长子串是 "abc"，所以其长度为 3。
示例2：
    输入: s = "bbbbb"
    输出: 1
    解释: 因为无重复字符的最长子串是 "b"，所以其长度为 1。
示例3：
    输入: s = "pwwkew"
    输出: 3
解释:
    因为无重复字符的最长子串是"wke"，所以其长度为3。
    请注意，你的答案必须是子串的长度，"pwke"是一个子序列，不是子串。
示例4：
    输入: s = ""
    输出: 0
提示：
    0 <= s.length <= 5 * 104
    s 由英文字母、数字、符号和空格组成

来源：力扣（LeetCode）
链接：https://leetcode-cn.com/problems/longest-substring-without-repeating-characters
著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。*/

#include <iostream>
#include <string>
#include <set>
#include <deque>

using std::string;
using std::set;
using std::deque;

class Solution {
public:
    int lengthOfLongestSubstring(string& s) {
        if(s.length() <= 1)
            return s.length();
        deque<char> de;
        de.resize(0);
        int max = 0;
        int len = 0;
        for(int i = 0;i < s.length();i++)
        {
            char tmp = s.at(i);
            if(std::find(de.cbegin(),de.cend(),tmp) == de.cend())
            {
                de.push_back(tmp);
                len++;
                if(max < len)
                    max = len;
            }
            else
            {
                for(auto r = de.begin();r != de.end();++r)
                {
                    if(*r == tmp)
                    {
                        de.push_back(tmp);
                        de.pop_front();
                        break;
                    }
                    de.pop_front();
                    len--;
                }
            }
        }
        return max;
    }
};

